               p = adimat_pop1;
               a_r = adimat_adjsum(a_r, adimat_adjred(r, -((p./r .* a_p) ./ r)));
               tmpsa1 = a_p;
               a_p = a_zeros1(p);
               a_p = adimat_adjsum(a_p, adimat_adjred(p, tmpsa1 ./ r));
               q = adimat_pop1;
               a_tmpca1 = adimat_adjsum(a_tmpca1, adimat_adjred(tmpca1, a_q));
               a_q = a_zeros1(q);
               tmpca1 = adimat_pop1;
               a_q = adimat_adjsum(a_q, adimat_adjred(q, a_tmpca1 ./ r));
               a_r = adimat_adjsum(a_r, adimat_adjred(r, -((q./r .* a_tmpca1) ./ r)));
               a_tmpca1 = a_zeros1(tmpca1);
            elseif tmpba1 == 2
               noRotationHere = adimat_pop1;
            elseif tmpba1 == 3
               noRotationHere = adimat_pop1;
            else
               s = adimat_pop1;
               a_p = adimat_adjsum(a_p, adimat_adjred(p, a_s ./ tmpca1));
               a_tmpca1 = adimat_adjsum(a_tmpca1, adimat_adjred(tmpca1, -((p./tmpca1 .* a_s) ./ tmpca1)));
               a_s = a_zeros1(s);
               tmpca1 = adimat_pop1;
               a_vt = adimat_adjsum(a_vt, adimat_adjred(vt, a_tmpca1 .* c));
               a_c = adimat_adjsum(a_c, adimat_adjred(c, vt .* a_tmpca1));
               a_tmpca1 = a_zeros1(tmpca1);
               c = adimat_pop1;
               a_tmpca1 = adimat_adjsum(a_tmpca1, 0.5 .* a_c./sqrt(tmpca1));
               a_c = a_zeros1(c);
               tmpca1 = adimat_pop1;
               a_tmpca2 = adimat_adjsum(a_tmpca2, adimat_adjred(tmpca2, 0.5 .* a_tmpca1));
               a_tmpca1 = a_zeros1(tmpca1);
               tmpca2 = adimat_pop1;
               a_tmpca3 = adimat_adjsum(a_tmpca3, adimat_adjred(tmpca3, a_tmpca2));
               a_tmpca2 = a_zeros1(tmpca2);
               tmpca3 = adimat_pop1;
               a_r = adimat_adjsum(a_r, adimat_adjred(r, a_tmpca3 ./ vt));
               a_vt = adimat_adjsum(a_vt, adimat_adjred(vt, -((r./vt .* a_tmpca3) ./ vt)));
               a_tmpca3 = a_zeros1(tmpca3);
               vt = adimat_pop1;
               a_tmpca1 = adimat_adjsum(a_tmpca1, 0.5 .* a_vt./sqrt(tmpca1));
               a_vt = a_zeros1(vt);
               tmpca1 = adimat_pop1;
               a_tmpca2 = adimat_adjsum(a_tmpca2, adimat_adjred(tmpca2, a_tmpca1));
               a_tmpca5 = adimat_adjsum(a_tmpca5, adimat_adjred(tmpca5, a_tmpca1));
               a_tmpca1 = a_zeros1(tmpca1);
               tmpca2 = adimat_pop1;
               a_tmpca3 = adimat_adjsum(a_tmpca3, adimat_adjred(tmpca3, a_tmpca2 .* p));
               a_p = adimat_adjsum(a_p, adimat_adjred(p, tmpca3 .* a_tmpca2));
               a_tmpca2 = a_zeros1(tmpca2);
               tmpca3 = adimat_pop1;
               a_tmpca4 = adimat_adjsum(a_tmpca4, adimat_adjred(tmpca4, 4 .* a_tmpca3));
               a_tmpca3 = a_zeros1(tmpca3);
               tmpca4 = adimat_pop1;
               a_p = adimat_adjsum(a_p, call(@conj, a_tmpca4));
               a_tmpca4 = a_zeros1(tmpca4);
               tmpca5 = adimat_pop1;
               a_r = adimat_adjsum(a_r, adimat_adjred(r, a_tmpca5 .* r));
               a_r = adimat_adjsum(a_r, adimat_adjred(r, r .* a_tmpca5));
               a_tmpca5 = a_zeros1(tmpca5);
               p = adimat_pop1;
               a_q = adimat_adjsum(a_q, adimat_adjred(q, -((p./q .* a_p) ./ q)));
               tmpsa1 = a_p;
               a_p = a_zeros1(p);
               a_p = adimat_adjsum(a_p, adimat_adjred(p, tmpsa1 ./ q));
               r = adimat_pop1;
               a_tmpca1 = adimat_adjsum(a_tmpca1, adimat_adjred(tmpca1, -a_r));
               a_r = a_zeros1(r);
               tmpca1 = adimat_pop1;
               a_r = adimat_adjsum(a_r, adimat_adjred(r, a_tmpca1 ./ q));
               a_q = adimat_adjsum(a_q, adimat_adjred(q, -((r./q .* a_tmpca1) ./ q)));
               a_tmpca1 = a_zeros1(tmpca1);
            end
            z = adimat_pop_index1(z, k);
            a_r = adimat_adjsum(a_r, adimat_adjred(r, adimat_adjreshape(r, a_z(k))));
            a_z = a_zeros_index1(a_z, z, k);
            z = adimat_pop_index1(z, j);
            a_q = adimat_adjsum(a_q, adimat_adjred(q, adimat_adjreshape(q, a_z(j))));
            a_z = a_zeros_index1(a_z, z, j);
            r = adimat_pop1;
            a_A(:, k) = adimat_adjsum(a_A(:, k), a_ctranspose(adimat_adjmultl(A(:, k)', a_r, A(:, k)), A(:, k)));
            a_A(:, k) = adimat_adjsum(a_A(:, k), adimat_adjmultr(A(:, k), A(:, k)', a_r));
            a_r = a_zeros1(r);
            q = adimat_pop1;
            a_A(:, j) = adimat_adjsum(a_A(:, j), a_ctranspose(adimat_adjmultl(A(:, j)', a_q, A(:, j)), A(:, j)));
            a_A(:, j) = adimat_adjsum(a_A(:, j), adimat_adjmultr(A(:, j), A(:, j)', a_q));
            a_q = a_zeros1(q);
            p = adimat_pop1;
            a_A(:, j) = adimat_adjsum(a_A(:, j), a_ctranspose(adimat_adjmultl(A(:, j)', a_p, A(:, k)), A(:, j)));
            a_A(:, k) = adimat_adjsum(a_A(:, k), adimat_adjmultr(A(:, k), A(:, j)', a_p));
            a_p = a_zeros1(p);
            noRotationHere = adimat_pop1;
         end
         k = adimat_pop1;
      end
      [j rcount] = adimat_pop;
   end
   tmpba1 = adimat_pop1;
   if tmpba1 == 1
      z = adimat_pop_index1(z, 1);
      a_tmplia1 = adimat_adjsum(a_tmplia1, adimat_adjred(tmplia1, adimat_adjreshape(tmplia1, a_z(1))));
      a_z = a_zeros_index1(a_z, z, 1);
      tmplia1 = adimat_pop1;
      a_A = adimat_adjsum(a_A, a_ctranspose(adimat_adjmultl(A', a_tmplia1, A), A));
      a_A = adimat_adjsum(a_A, adimat_adjmultr(A, A', a_tmplia1));
      a_tmplia1 = a_zeros1(tmplia1);
   end
   tmpba1 = adimat_pop1;
   if tmpba1 == 1
      V = adimat_pop1;
      a_V = a_zeros1(V);
   end
end

function [z A V nt] = rec_adimat_onesided_jacobi(A, nA1)
   tmplia1 = 0;
   tmpca1 = 0;
   tmpca5 = 0;
   tmpca4 = 0;
   tmpca3 = 0;
   tmpca2 = 0;
   j = 0;
   k = 0;
   V = 0;
   p = 0;
   q = 0;
   r = 0;
   vt = 0;
   s = 0;
   c = 0;
   G = 0;
   [m n] = size(A);
   nt = n;
   slimit = max(n ./ 4, 6) .* 10;
   tmpba1 = 0;
   if nargout > 2
      tmpba1 = 1;
      adimat_push1(V);
      V = eye(n, n);
   end
   adimat_push1(tmpba1);
   z = zeros(nt, 1);
   tmpba1 = 0;
   if nt == 1
      tmpba1 = 1;
      adimat_push1(tmplia1);
      tmplia1 = A' * A;
      adimat_push_index1(z, 1);
      z(1) = tmplia1;
   end
   adimat_push1(tmpba1);
   tol = eps;
   noRotationHere = 0;
   scount = 0;
   rcount = (nt .* (nt - 1)) ./ 2;
   tmpla1 = 0;
   while scount<=slimit && rcount>0
      tmpla1 = tmpla1 + 1;
      adimat_push1(rcount);
      rcount = (nt .* (nt - 1)) ./ 2;
      tmpfra1_2 = nt - 1;
      adimat_push1(j);
      for j=1 : tmpfra1_2
         tmpfra2_1 = j + 1;
         tmpfra2_2 = nt;
         adimat_push1(k);
         for k=tmpfra2_1 : tmpfra2_2
            adimat_push1(noRotationHere);
            noRotationHere = 0;
            adimat_push1(p);
            p = A(:, j)' * A(:, k);
            adimat_push1(q);
            q = A(:, j)' * A(:, j);
            adimat_push1(r);
            r = A(:, k)' * A(:, k);
            adimat_push_index1(z, j);
            z(j) = q;
            adimat_push_index1(z, k);
            z(k) = r;
            tmpba1 = 0;
            if q < r
               tmpba1 = 1;
               adimat_push1(tmpca1);
               tmpca1 = q ./ r;
               adimat_push1(q);
               q = tmpca1 - 1;
               adimat_push1(p);
               p = p ./ r;
               adimat_push1(tmpca5);
               tmpca5 = q .* q;
               adimat_push1(tmpca4);
               tmpca4 = conj(p);
               adimat_push1(tmpca3);
               tmpca3 = 4 .* tmpca4;
               adimat_push1(tmpca2);
               tmpca2 = tmpca3 .* p;
               adimat_push1(tmpca1);
               tmpca1 = tmpca2 + tmpca5;
               adimat_push1(vt);
               vt = sqrt(tmpca1);
               adimat_push1(tmpca3);
               tmpca3 = q ./ vt;
               adimat_push1(tmpca2);
               tmpca2 = 1 - tmpca3;
               adimat_push1(tmpca1);
               tmpca1 = 0.5 .* tmpca2;
               adimat_push1(s);
               s = sqrt(tmpca1);
               tmpba2 = 0;
               if p < 0
                  tmpba2 = 1;
                  adimat_push1(s);
                  s = -s;
               end
               adimat_push(tmpba2, tmpca1);
               tmpca1 = vt .* s;
               adimat_push1(c);
               c = p ./ tmpca1;
            elseif q.*r <= eps.^2.*nA1
               tmpba1 = 2;
               adimat_push1(noRotationHere);
               noRotationHere = 1;
            elseif (p ./ q)'.*p./r <= eps.^2.*nA1
               tmpba1 = 3;
               adimat_push1(noRotationHere);
               noRotationHere = 1;
            else
               adimat_push1(tmpca1);
               tmpca1 = r ./ q;
               adimat_push1(r);
               r = 1 - tmpca1;
               adimat_push1(p);
               p = p ./ q;
               adimat_push1(tmpca5);
               tmpca5 = r .* r;
               adimat_push1(tmpca4);
               tmpca4 = conj(p);
               adimat_push1(tmpca3);
               tmpca3 = 4 .* tmpca4;
               adimat_push1(tmpca2);
               tmpca2 = tmpca3 .* p;
               adimat_push1(tmpca1);
               tmpca1 = tmpca2 + tmpca5;
               adimat_push1(vt);
               vt = sqrt(tmpca1);
               adimat_push1(tmpca3);
               tmpca3 = r ./ vt;
               adimat_push1(tmpca2);
               tmpca2 = 1 + tmpca3;
               adimat_push1(tmpca1);
               tmpca1 = 0.5 .* tmpca2;
               adimat_push1(c);
               c = sqrt(tmpca1);
               adimat_push1(tmpca1);
               tmpca1 = vt .* c;
               adimat_push1(s);
               s = p ./ tmpca1;
            end
            adimat_push1(tmpba1);
            tmpba1 = 0;
            if noRotationHere == 0
               tmpba1 = 1;
               adimat_push1(G);
               G = rec_mk_givens(c, s, n, j, k);
               adimat_push1(A);
               A = A * G;
               tmpba2 = 0;
               if nargout > 2
                  tmpba2 = 1;
                  adimat_push1(tmpca1);
                  tmpca1 = V * G;
                  adimat_push1(V);
                  V = full(tmpca1);
               end
               adimat_push1(tmpba2);
            else
               adimat_push1(rcount);
               rcount = rcount - 1;
            end
            adimat_push1(tmpba1);
         end
         adimat_push(tmpfra2_1, tmpfra2_2);
      end
      adimat_push1(tmpfra1_2);
      tmpba1 = 0;
      if nt > 1
         tmpba1 = 1;
         tmpba2 = 0;
         if z(nt)./(z(1) + tol) <= tol
            tmpba2 = 1;
            adimat_push1(nt);
            nt = nt - 1;
         end
         adimat_push1(tmpba2);
      end
      adimat_push(tmpba1, scount);
      scount = scount + 1;
   end
   adimat_push1(tmpla1);
   tmpba1 = 0;
   if nargout > 1
      tmpba1 = 1;
   end
   adimat_push1(tmpba1);
   tmpba1 = 0;
   if scount > slimit
      tmpba1 = 1;
      error('adimat:onesided_jacobi:too_many_sweeps', 'Too many sweeps (%d) in one-sided Jacobi scheme', scount);
   end
   adimat_push(tmpba1, j, k, p, q, r, vt, s, c, G, m, n, slimit, tmplia1, tol, noRotationHere, scount, rcount, tmpca1, tmpca5, tmpca4, tmpca3, tmpca2, z, A, V, nt, A);
   if nargin > 1
      adimat_push1(nA1);
   end
   adimat_push1(nargin);
end

function a_A = ret_adimat_onesided_jacobi(a_z, a_A, a_V)
   tmpnargin = adimat_pop1;
   if tmpnargin > 1
      nA1 = adimat_pop1;
   end
   [A nt V A z tmpca2 tmpca3 tmpca4 tmpca5 tmpca1 rcount scount noRotationHere tol tmplia1 slimit n m G c s vt r q p k j] = adimat_pop;
   [a_p a_q a_r a_vt a_s a_c a_G a_tmplia1 a_tmpca1 a_tmpca5 a_tmpca4 a_tmpca3 a_tmpca2] = a_zeros(p, q, r, vt, s, c, G, tmplia1, tmpca1, tmpca5, tmpca4, tmpca3, tmpca2);
   if nargin < 1
      a_z = a_zeros1(z);
   end
   if nargin < 2
      a_A = a_zeros1(A);
   end
   if nargin < 3
      a_V = a_zeros1(V);
   end
   tmpba1 = adimat_pop1;
   if tmpba1 == 1
      error('adimat:onesided_jacobi:too_many_sweeps', 'Too many sweeps (%d) in one-sided Jacobi scheme', scount);
   end
   tmpba1 = adimat_pop1;
   if tmpba1 == 1
   end
   tmpla1 = adimat_pop1;
   while tmpla1 > 0
      tmpla1 = tmpla1 - 1;
      [scount tmpba1] = adimat_pop;
      if tmpba1 == 1
         tmpba2 = adimat_pop1;
         if tmpba2 == 1
            nt = adimat_pop1;
         end
      end
      tmpfra1_2 = adimat_pop1;
      for j=fliplr(1 : tmpfra1_2)
         [tmpfra2_2 tmpfra2_1] = adimat_pop;
         for k=fliplr(tmpfra2_1 : tmpfra2_2)
            tmpba1 = adimat_pop1;
            if tmpba1 == 1
               tmpba2 = adimat_pop1;
               if tmpba2 == 1
                  V = adimat_pop1;
                  a_tmpca1 = adimat_adjsum(a_tmpca1, a_full(a_V, tmpca1));
                  a_V = a_zeros1(V);
                  tmpca1 = adimat_pop1;
                  a_V = adimat_adjsum(a_V, adimat_adjmultl(V, a_tmpca1, G));
                  a_G = adimat_adjsum(a_G, adimat_adjmultr(G, V, a_tmpca1));
                  a_tmpca1 = a_zeros1(tmpca1);
               end
               A = adimat_pop1;
               a_G = adimat_adjsum(a_G, adimat_adjmultr(G, A, a_A));
               tmpsa1 = a_A;
               a_A = a_zeros1(A);
               a_A = adimat_adjsum(a_A, adimat_adjmultl(A, tmpsa1, G));
               [tmpadjc1 tmpadjc2] = ret_mk_givens(a_G);
               G = adimat_pop1;
               a_c = adimat_adjsum(a_c, tmpadjc1);
               a_s = adimat_adjsum(a_s, tmpadjc2);
               a_G = a_zeros1(G);
            else
               rcount = adimat_pop1;
            end
            tmpba1 = adimat_pop1;
            if tmpba1 == 1
               c = adimat_pop1;
               a_p = adimat_adjsum(a_p, adimat_adjred(p, a_c ./ tmpca1));
               a_tmpca1 = adimat_adjsum(a_tmpca1, adimat_adjred(tmpca1, -((p./tmpca1 .* a_c) ./ tmpca1)));
               a_c = a_zeros1(c);
               tmpca1 = adimat_pop1;
               a_vt = adimat_adjsum(a_vt, adimat_adjred(vt, a_tmpca1 .* s));
               a_s = adimat_adjsum(a_s, adimat_adjred(s, vt .* a_tmpca1));
               a_tmpca1 = a_zeros1(tmpca1);
               tmpba2 = adimat_pop1;
               if tmpba2 == 1
                  s = adimat_pop1;
                  tmpsa1 = a_s;
                  a_s = a_zeros1(s);
                  a_s = adimat_adjsum(a_s, -tmpsa1);
               end
               s = adimat_pop1;
               a_tmpca1 = adimat_adjsum(a_tmpca1, 0.5 .* a_s./sqrt(tmpca1));
               a_s = a_zeros1(s);
               tmpca1 = adimat_pop1;
               a_tmpca2 = adimat_adjsum(a_tmpca2, adimat_adjred(tmpca2, 0.5 .* a_tmpca1));
               a_tmpca1 = a_zeros1(tmpca1);
               tmpca2 = adimat_pop1;
               a_tmpca3 = adimat_adjsum(a_tmpca3, adimat_adjred(tmpca3, -a_tmpca2));
               a_tmpca2 = a_zeros1(tmpca2);
               tmpca3 = adimat_pop1;
               a_q = adimat_adjsum(a_q, adimat_adjred(q, a_tmpca3 ./ vt));
               a_vt = adimat_adjsum(a_vt, adimat_adjred(vt, -((q./vt .* a_tmpca3) ./ vt)));
               a_tmpca3 = a_zeros1(tmpca3);
               vt = adimat_pop1;
               a_tmpca1 = adimat_adjsum(a_tmpca1, 0.5 .* a_vt./sqrt(tmpca1));
               a_vt = a_zeros1(vt);
               tmpca1 = adimat_pop1;
               a_tmpca2 = adimat_adjsum(a_tmpca2, adimat_adjred(tmpca2, a_tmpca1));
               a_tmpca5 = adimat_adjsum(a_tmpca5, adimat_adjred(tmpca5, a_tmpca1));
               a_tmpca1 = a_zeros1(tmpca1);
               tmpca2 = adimat_pop1;
               a_tmpca3 = adimat_adjsum(a_tmpca3, adimat_adjred(tmpca3, a_tmpca2 .* p));
               a_p = adimat_adjsum(a_p, adimat_adjred(p, tmpca3 .* a_tmpca2));
               a_tmpca2 = a_zeros1(tmpca2);
               tmpca3 = adimat_pop1;
               a_tmpca4 = adimat_adjsum(a_tmpca4, adimat_adjred(tmpca4, 4 .* a_tmpca3));
               a_tmpca3 = a_zeros1(tmpca3);
               tmpca4 = adimat_pop1;
               a_p = adimat_adjsum(a_p, call(@conj, a_tmpca4));
               a_tmpca4 = a_zeros1(tmpca4);
               tmpca5 = adimat_pop1;
               a_q = adimat_adjsum(a_q, adimat_adjred(q, a_tmpca5 .* q));
               a_q = adimat_adjsum(a_q, adimat_adjred(q, q .* a_tmpca5));
               a_tmpca5 = a_zeros1(tmpca5);
               p = adimat_pop1;
               a_r = adimat_adjsum(a_r, adimat_adjred(r, -((p./r .* a_p) ./ r)));
               tmpsa1 = a_p;
               a_p = a_zeros1(p);
               a_p = adimat_adjsum(a_p, adimat_adjred(p, tmpsa1 ./ r));
               q = adimat_pop1;
               a_tmpca1 = adimat_adjsum(a_tmpca1, adimat_adjred(tmpca1, a_q));
               a_q = a_zeros1(q);
               tmpca1 = adimat_pop1;
               a_q = adimat_adjsum(a_q, adimat_adjred(q, a_tmpca1 ./ r));
               a_r = adimat_adjsum(a_r, adimat_adjred(r, -((q./r .* a_tmpca1) ./ r)));
               a_tmpca1 = a_zeros1(tmpca1);
            elseif tmpba1 == 2
               noRotationHere = adimat_pop1;
            elseif tmpba1 == 3
               noRotationHere = adimat_pop1;
            else
               s = adimat_pop1;
               a_p = adimat_adjsum(a_p, adimat_adjred(p, a_s ./ tmpca1));
               a_tmpca1 = adimat_adjsum(a_tmpca1, adimat_adjred(tmpca1, -((p./tmpca1 .* a_s) ./ tmpca1)));
               a_s = a_zeros1(s);
               tmpca1 = adimat_pop1;
               a_vt = adimat_adjsum(a_vt, adimat_adjred(vt, a_tmpca1 .* c));
               a_c = adimat_adjsum(a_c, adimat_adjred(c, vt .* a_tmpca1));
               a_tmpca1 = a_zeros1(tmpca1);
               c = adimat_pop1;
               a_tmpca1 = adimat_adjsum(a_tmpca1, 0.5 .* a_c./sqrt(tmpca1));
               a_c = a_zeros1(c);
               tmpca1 = adimat_pop1;
               a_tmpca2 = adimat_adjsum(a_tmpca2, adimat_adjred(tmpca2, 0.5 .* a_tmpca1));
               a_tmpca1 = a_zeros1(tmpca1);
               tmpca2 = adimat_pop1;
               a_tmpca3 = adimat_adjsum(a_tmpca3, adimat_adjred(tmpca3, a_tmpca2));
               a_tmpca2 = a_zeros1(tmpca2);
               tmpca3 = adimat_pop1;
               a_r = adimat_adjsum(a_r, adimat_adjred(r, a_tmpca3 ./ vt));
               a_vt = adimat_adjsum(a_vt, adimat_adjred(vt, -((r./vt .* a_tmpca3) ./ vt)));
               a_tmpca3 = a_zeros1(tmpca3);
               vt = adimat_pop1;
               a_tmpca1 = adimat_adjsum(a_tmpca1, 0.5 .* a_vt./sqrt(tmpca1));
               a_vt = a_zeros1(vt);
               tmpca1 = adimat_pop1;
               a_tmpca2 = adimat_adjsum(a_tmpca2, adimat_adjred(tmpca2, a_tmpca1));
               a_tmpca5 = adimat_adjsum(a_tmpca5, adimat_adjred(tmpca5, a_tmpca1));
               a_tmpca1 = a_zeros1(tmpca1);
               tmpca2 = adimat_pop1;
               a_tmpca3 = adimat_adjsum(a_tmpca3, adimat_adjred(tmpca3, a_tmpca2 .* p));
               a_p = adimat_adjsum(a_p, adimat_adjred(p, tmpca3 .* a_tmpca2));
               a_tmpca2 = a_zeros1(tmpca2);
               tmpca3 = adimat_pop1;
               a_tmpca4 = adimat_adjsum(a_tmpca4, adimat_adjred(tmpca4, 4 .* a_tmpca3));
               a_tmpca3 = a_zeros1(tmpca3);
               tmpca4 = adimat_pop1;
               a_p = adimat_adjsum(a_p, call(@conj, a_tmpca4));
               a_tmpca4 = a_zeros1(tmpca4);
               tmpca5 = adimat_pop1;
               a_r = adimat_adjsum(a_r, adimat_adjred(r, a_tmpca5 .* r));
               a_r = adimat_adjsum(a_r, adimat_adjred(r, r .* a_tmpca5));
               a_tmpca5 = a_zeros1(tmpca5);
               p = adimat_pop1;
               a_q = adimat_adjsum(a_q, adimat_adjred(q, -((p./q .* a_p) ./ q)));
               tmpsa1 = a_p;
               a_p = a_zeros1(p);
               a_p = adimat_adjsum(a_p, adimat_adjred(p, tmpsa1 ./ q));
               r = adimat_pop1;
               a_tmpca1 = adimat_adjsum(a_tmpca1, adimat_adjred(tmpca1, -a_r));
               a_r = a_zeros1(r);
               tmpca1 = adimat_pop1;
               a_r = adimat_adjsum(a_r, adimat_adjred(r, a_tmpca1 ./ q));
               a_q = adimat_adjsum(a_q, adimat_adjred(q, -((r./q .* a_tmpca1) ./ q)));
               a_tmpca1 = a_zeros1(tmpca1);
            end
            z = adimat_pop_index1(z, k);
            a_r = adimat_adjsum(a_r, adimat_adjred(r, adimat_adjreshape(r, a_z(k))));
            a_z = a_zeros_index1(a_z, z, k);
            z = adimat_pop_index1(z, j);
            a_q = adimat_adjsum(a_q, adimat_adjred(q, adimat_adjreshape(q, a_z(j))));
            a_z = a_zeros_index1(a_z, z, j);
            r = adimat_pop1;
            a_A(:, k) = adimat_adjsum(a_A(:, k), a_ctranspose(adimat_adjmultl(A(:, k)', a_r, A(:, k)), A(:, k)));
            a_A(:, k) = adimat_adjsum(a_A(:, k), adimat_adjmultr(A(:, k), A(:, k)', a_r));
            a_r = a_zeros1(r);
            q = adimat_pop1;
            a_A(:, j) = adimat_adjsum(a_A(:, j), a_ctranspose(adimat_adjmultl(A(:, j)', a_q, A(:, j)), A(:, j)));
            a_A(:, j) = adimat_adjsum(a_A(:, j), adimat_adjmultr(A(:, j), A(:, j)', a_q));
            a_q = a_zeros1(q);
            p = adimat_pop1;
            a_A(:, j) = adimat_adjsum(a_A(:, j), a_ctranspose(adimat_adjmultl(A(:, j)', a_p, A(:, k)), A(:, j)));
            a_A(:, k) = adimat_adjsum(a_A(:, k), adimat_adjmultr(A(:, k), A(:, j)', a_p));
            a_p = a_zeros1(p);
            noRotationHere = adimat_pop1;
         end
         k = adimat_pop1;
      end
      [j rcount] = adimat_pop;
   end
   tmpba1 = adimat_pop1;
   if tmpba1 == 1
      z = adimat_pop_index1(z, 1);
      a_tmplia1 = adimat_adjsum(a_tmplia1, adimat_adjred(tmplia1, adimat_adjreshape(tmplia1, a_z(1))));
      a_z = a_zeros_index1(a_z, z, 1);
      tmplia1 = adimat_pop1;
      a_A = adimat_adjsum(a_A, a_ctranspose(adimat_adjmultl(A', a_tmplia1, A), A));
      a_A = adimat_adjsum(a_A, adimat_adjmultr(A, A', a_tmplia1));
      a_tmplia1 = a_zeros1(tmplia1);
   end
   tmpba1 = adimat_pop1;
   if tmpba1 == 1
      V = adimat_pop1;
      a_V = a_zeros1(V);
   end
end
