function [a_A a_qk nr_Q nr_H nr_hkkm1] = a_adimat_arnoldi(A, m, qk, a_Q, a_hkkm1)
   tmpda2 = 0;
   tmpda1 = 0;
   j = 0;
   hkkm1 = 0;
   hjkm1 = 0;
   n = size(A, 1);
   tmpba1 = 0;
   if nargin < 2
      tmpba1 = 1;
      adimat_push1(m);
      m = n;
   end
   adimat_push1(tmpba1);
   H = zeros(m);
   Q = eye(n, m);
   tmpba1 = 0;
   if nargin < 3
      tmpba1 = 1;
      tmpba2 = 0;
      if isreal(A)
         tmpba2 = 1;
         adimat_push1(qk);
         qk = rand(n, 1);
      else
         adimat_push1(tmpda2);
         tmpda2 = rand(n, 1);
         adimat_push1(tmpda1);
         tmpda1 = rand(n, 1);
         adimat_push1(qk);
         qk = complex(tmpda1, tmpda2);
      end
      adimat_push1(tmpba2);
   end
   adimat_push1(tmpba1);
   nexist = size(qk, 2);
   adimat_push_index2(Q, ':', 1 : nexist);
   Q(:, 1 : nexist) = qk;
   adimat_push1(qk);
   qk = qk(:, end);
   tmpca1 = norm(qk);
   adimat_push1(qk);
   qk = qk ./ tmpca1;
   startInd = 1;
   tmplea1 = 0;
   tmpfra1_1 = nexist + 1;
   tmpfra1_2 = m + 1;
   for k=tmpfra1_1 : tmpfra1_2
      adimat_push1(qk);
      qk = A * qk;
      tmpfra2_1 = startInd;
