      a_Q = a_zeros_index2(a_Q, Q, ':', k);
      H = adimat_pop_index2(H, k, k - 1);
      qk = adimat_pop1;
      a_hkkm1 = adimat_adjsum(a_hkkm1, adimat_adjred(hkkm1, -((qk./hkkm1 .* a_qk) ./ hkkm1)));
      tmpsa1 = a_qk;
      a_qk = a_zeros1(qk);
      a_qk = adimat_adjsum(a_qk, adimat_adjred(qk, tmpsa1 ./ hkkm1));
      tmpba1 = adimat_pop1;
      if tmpba1 == 1
      end
      tmpba1 = adimat_pop1;
      if tmpba1 == 1
         tmpba2 = adimat_pop1;
         if tmpba2 == 1
            tmpba3 = adimat_pop1;
            if tmpba3 == 1
               warning('adimat:arnoldi:failure', 'Very large error in Arnoldi iteration k=%d:%g', k, hkkm1);
            end
            tmpba3 = adimat_pop1;
            if tmpba3 == 1
               warning('adimat:arnoldi:inaccurate', 'Large error in Arnoldi iteration k=%d:%g', k, hkkm1);
            end
         end
      else
         tmpba2 = adimat_pop1;
         if tmpba2 == 1
            warning('adimat:arnoldi:breakdown', 'Breakdown in Arnoldi iteration at k=%d', k);
         end
      end
      tmpba1 = adimat_pop1;
      if tmpba1 == 1
         hkkm1 = adimat_pop1;
         a_hkkm1 = a_zeros1(hkkm1);
      else
         hkkm1 = adimat_pop1;
         a_qk = adimat_adjsum(a_qk, a_adimat_norm1(qk, a_hkkm1));
         a_hkkm1 = a_zeros1(hkkm1);
      end
      [tmpfra2_2 tmpfra2_1] = adimat_pop;
      for j=fliplr(tmpfra2_1 : tmpfra2_2)
         H = adimat_pop_index2(H, j, k - 1);
         qk = adimat_pop1;
         a_tmpca1 = adimat_adjsum(a_tmpca1, adimat_adjred(tmpca1, -a_qk));
         tmpsa1 = a_qk;
         a_qk = a_zeros1(qk);
         a_qk = adimat_adjsum(a_qk, adimat_adjred(qk, tmpsa1));
         tmpca1 = adimat_pop1;
         a_hjkm1 = adimat_adjsum(a_hjkm1, adimat_adjred(hjkm1, a_tmpca1 .* Q(:, j)));
         a_Q(:, j) = adimat_adjsum(a_Q(:, j), adimat_adjred(Q(:, j), hjkm1 .* a_tmpca1));
         a_tmpca1 = a_zeros1(tmpca1);
         hjkm1 = adimat_pop1;
         a_Q(:, j) = adimat_adjsum(a_Q(:, j), a_ctranspose(adimat_adjmultl(Q(:, j)', a_hjkm1, qk), Q(:, j)));
         a_qk = adimat_adjsum(a_qk, adimat_adjmultr(qk, Q(:, j)', a_hjkm1));
         a_hjkm1 = a_zeros1(hjkm1);
      end
      [j qk] = adimat_pop;
      a_A = adimat_adjsum(a_A, adimat_adjmultl(A, a_qk, qk));
      tmpsa1 = a_qk;
      a_qk = a_zeros1(qk);
      a_qk = adimat_adjsum(a_qk, adimat_adjmultr(qk, A, tmpsa1));
   end
   qk = adimat_pop1;
   a_tmpca1 = adimat_adjsum(a_tmpca1, adimat_adjred(tmpca1, -((qk./tmpca1 .* a_qk) ./ tmpca1)));
   tmpsa1 = a_qk;
   a_qk = a_zeros1(qk);
   a_qk = adimat_adjsum(a_qk, adimat_adjred(qk, tmpsa1 ./ tmpca1));
   a_qk = adimat_adjsum(a_qk, a_adimat_norm1(qk, a_tmpca1));
   qk = adimat_pop1;
   tmpsa1 = a_qk;
   a_qk = a_zeros1(qk);
   a_qk(:, end) = adimat_adjsum(a_qk(:, end), tmpsa1);
   Q = adimat_pop_index2(Q, ':', 1 : nexist);
   a_qk = adimat_adjsum(a_qk, adimat_adjred(qk, adimat_adjreshape(qk, a_Q(:, 1 : nexist))));
   a_Q = a_zeros_index2(a_Q, Q, ':', 1 : nexist);
   tmpba1 = adimat_pop1;
   if tmpba1 == 1
      tmpba2 = adimat_pop1;
      if tmpba2 == 1
         qk = adimat_pop1;
         a_qk = a_zeros1(qk);
      else
         qk = adimat_pop1;
         a_qk = a_zeros1(qk);
         [tmpda1 tmpda2] = adimat_pop;
      end
   end
   tmpba1 = adimat_pop1;
   if tmpba1 == 1
      m = adimat_pop1;
   end
end
