function [a_c a_s nr_G] = a_mk_givens(c, s, n, i, j, a_G)
   G = speye(n);
   adimat_push_index2(G, i, i);
   G(i, i) = c;
   tmplia1 = conj(c);
   adimat_push_index2(G, j, j);
   G(j, j) = tmplia1;
   adimat_push1(tmplia1);
   tmplia1 = -s;
   adimat_push_index2(G, i, j);
   G(i, j) = tmplia1;
   adimat_push1(tmplia1);
   tmplia1 = conj(s);
   adimat_push_index2(G, j, i);
   G(j, i) = tmplia1;
   nr_G = G;
   [a_tmplia1 a_c a_s] = a_zeros(tmplia1, c, s);
   if nargin < 6
      a_G = a_zeros1(G);
   end
   G = adimat_pop_index2(G, j, i);
   a_tmplia1 = adimat_adjsum(a_tmplia1, adimat_adjred(tmplia1, adimat_adjreshape(tmplia1, a_G(j, i))));
   a_G = a_zeros_index2(a_G, G, j, i);
   tmplia1 = adimat_pop1;
   a_s = adimat_adjsum(a_s, call(@conj, a_tmplia1));
   a_tmplia1 = a_zeros1(tmplia1);
   G = adimat_pop_index2(G, i, j);
   a_tmplia1 = adimat_adjsum(a_tmplia1, adimat_adjred(tmplia1, adimat_adjreshape(tmplia1, a_G(i, j))));
   a_G = a_zeros_index2(a_G, G, i, j);
   tmplia1 = adimat_pop1;
   a_s = adimat_adjsum(a_s, -a_tmplia1);
   a_tmplia1 = a_zeros1(tmplia1);
   G = adimat_pop_index2(G, j, j);
   a_tmplia1 = adimat_adjsum(a_tmplia1, adimat_adjred(tmplia1, adimat_adjreshape(tmplia1, a_G(j, j))));
   a_G = a_zeros_index2(a_G, G, j, j);
   a_c = adimat_adjsum(a_c, call(@conj, a_tmplia1));
   G = adimat_pop_index2(G, i, i);
   a_c = adimat_adjsum(a_c, adimat_adjred(c, adimat_adjreshape(c, a_G(i, i))));
   a_G = a_zeros_index2(a_G, G, i, i);
end

function G = rec_mk_givens(c, s, n, i, j)
   G = speye(n);
   adimat_push_index2(G, i, i);
   G(i, i) = c;
   tmplia1 = conj(c);
   adimat_push_index2(G, j, j);
   G(j, j) = tmplia1;
   adimat_push1(tmplia1);
   tmplia1 = -s;
   adimat_push_index2(G, i, j);
   G(i, j) = tmplia1;
   adimat_push1(tmplia1);
   tmplia1 = conj(s);
   adimat_push_index2(G, j, i);
   G(j, i) = tmplia1;
   adimat_push(tmplia1, G, c, s);
   if nargin > 2
      adimat_push1(n);
   end
   if nargin > 3
      adimat_push1(i);
   end
   if nargin > 4
      adimat_push1(j);
   end
   adimat_push1(nargin);
end

function [a_c a_s] = ret_mk_givens(a_G)
   tmpnargin = adimat_pop1;
   if tmpnargin > 4
      j = adimat_pop1;
   end
   if tmpnargin > 3
      i = adimat_pop1;
   end
   if tmpnargin > 2
      n = adimat_pop1;
   end
   [s c G tmplia1] = adimat_pop;
   [a_tmplia1 a_c a_s] = a_zeros(tmplia1, c, s);
   if nargin < 1
      a_G = a_zeros1(G);
   end
   G = adimat_pop_index2(G, j, i);
   a_tmplia1 = adimat_adjsum(a_tmplia1, adimat_adjred(tmplia1, adimat_adjreshape(tmplia1, a_G(j, i))));
   a_G = a_zeros_index2(a_G, G, j, i);
   tmplia1 = adimat_pop1;
   a_s = adimat_adjsum(a_s, call(@conj, a_tmplia1));
   a_tmplia1 = a_zeros1(tmplia1);
   G = adimat_pop_index2(G, i, j);
   a_tmplia1 = adimat_adjsum(a_tmplia1, adimat_adjred(tmplia1, adimat_adjreshape(tmplia1, a_G(i, j))));
   a_G = a_zeros_index2(a_G, G, i, j);
   tmplia1 = adimat_pop1;
   a_s = adimat_adjsum(a_s, -a_tmplia1);
   a_tmplia1 = a_zeros1(tmplia1);
   G = adimat_pop_index2(G, j, j);
   a_tmplia1 = adimat_adjsum(a_tmplia1, adimat_adjred(tmplia1, adimat_adjreshape(tmplia1, a_G(j, j))));
   a_G = a_zeros_index2(a_G, G, j, j);
   a_c = adimat_adjsum(a_c, call(@conj, a_tmplia1));
   G = adimat_pop_index2(G, i, i);
   a_c = adimat_adjsum(a_c, adimat_adjred(c, adimat_adjreshape(c, a_G(i, i))));
   a_G = a_zeros_index2(a_G, G, i, i);
end
